import PropTypes from 'prop-types';

const Column = props => {
    const { title, data, dataIndex, ...columnProps } = props;

    return (
        <>
            {data.map(user => (
                <tr>
                    <td className='px-6 py-4 whitespace-nowrap'>
                        <div className='flex items-center'>
                            <div className='text-sm font-medium text-gray-900'>{user[dataIndex]}</div>
                        </div>
                    </td>
                </tr>
            ))}
        </>
    );
};

Column.propTypes = {};

export default Column;
